import Footer from './components/Footer';
import Navbar from './components/Navbar';
import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
	<Navbar />
      </header>
      <Body />
      <Footer />
    </div>
  );
}

export default App;
